  \"Mercury in fish collected from the Indian Lakes System : Stillwater Wildlife Management
  Area\",\n\t\"tracking_summary\": {\n\t\t\"total\": 21,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:18:29.339650\",\n\t\"name\":
  \"mercury-in-fish-collected-from-the-indian-lakes-system-stillwater-wildlife-management-area\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study was initiated by the U.S. Fish
  and Wildlife Service to assess the extent and severity of mercury contamination
  in fish collected from the five principal lakes of the Indian Lakes System. Specific
  objectives were to: 1) determine levels and assess variability of mercury in composite
  muscle samples from fish of two trophic levels collected from the five lakes; 2)
  assess variability of mercury levels in muscle of one fish species collected from
  one lake; and 3) identify lakes in which biological contamination has the potential
  to adversely affect fish, wildlife, and humans.    Mercury concentrations in muscle
  of three species of fish collected from five primary lakes of the Indian Lakes system
  exceeded the carp muscle background concentration of 0.41 fig/g wet weight previously
  identified.    Concentrations were higher in picivorous fish than in omnivorous
  fish.  The highest levels were found in white bass (1.0 to 2.7 pg/g wet weight),
  followed by white crappie (0.9 to 1.8 pg/g wet weight) and carp (0.5 to 0.8 pg/g
  wet weight). Differences in mercury levels were found between lakes; however, these
  differences were not consistent for all species.  Mercury concentrations in picivorous
  fish approached or exceeded levels that may adversely affect reproduction. Concentrations
  in all fish exceeded levels that may adversely affect avian predators. Mercury concentrations
  found in fish also exceeded levels considered safe for human consumption.\",\n\t\"license_title\":
